script: |
  super -f text -I q5556.spq | sort > q5556.out

inputs:
  - name: q5556.spq
    data: |
      SELECT DISTINCT col2 + + + ( - CAST ( + col2 AS INTEGER ) ) FROM tab1 (FORMAT parquet) WHERE NOT NULL BETWEEN + + 57 * - col0 + + - col1 AND col2;
  - name: tab1

outputs:
  - name: q5556.out
    data: |
